import aboutUsLogo from '../images/logoAboutUs.jpg'
export default function AboutUs(){
    return(
        <>
        <div className="container-fluid">
            <div className="row">
                <div className="col-lg-6">
                    <img src={aboutUsLogo} alt="About Us Logo"/>
                </div>
                <div className="col-lg-6"></div>
            </div>
        </div>
        </>
    );
}
